import React from 'react'
import styled from 'styled-components'

function LogoComponent() {

    const Logo = styled.h1`
        display: inline-block;
        color: ${({theme}) => theme.text};
        font-family: 'Pacifico',cursive;
        position: fixed;
        left:2rem;
        top:2rem;
        z-index:3;
    `

    return (
        <Logo>
            DIM
        </Logo>
    )
}

export default LogoComponent
